/**
 * Learn more about deep linking with React Navigation
 * https://reactnavigation.org/docs/deep-linking
 * https://reactnavigation.org/docs/configuring-links
 */

import { LinkingOptions } from '@react-navigation/native';
import * as Linking from 'expo-linking';

import { RootStackParamList } from '../types';

const linking: LinkingOptions<RootStackParamList> = {
  prefixes: [Linking.makeUrl('/')],
  config: {
    screens: {
      Root: {
        screens: {
          Inicio:{ screens:{ Inicio: 'inicio',}, },

          SignUp:{ screens:{ SignUp: 'SignUp'},  },

          VerProyectos:{ screens:{ VerProyectos: 'verProyectos'},  }, 

          VerInscripciones:{ screens:{ VerInscripciones: 'VerInscripciones'},  },    

          VerAvances:{ screens:{ VerAvances: 'VerAvances'},  },           
        },  
      },        
      Modal: 'modal',
      NotFound: '*',
    },
  },
};

export default linking;
